import React from 'react';
import { Col, Row } from 'react-bootstrap';

const RegsCard = ({regs}) => {
    return (
    <Row >
        <Col>
            <div>{regs.month} - </div>
        </Col>
        <Col>
            <div>{regs.amount} регистраций</div>
        </Col>
    </Row>
    );
};

export default RegsCard;
